import { Section, Typography, Container } from "@toptal/picasso";
import { Code16 } from "@toptal/picasso/Icon";

const ContentLeft = () => {
  return (
    <Section
      title={
        <Typography variant="heading" size="xlarge">
          Box 1 title
        </Typography>
      }
      variant="bordered"
    >
      <Container flex gap={0.5} alignItems="center">
        <Code16 />
        <Typography color="green">Hover over the icon for more info</Typography>
      </Container>
      <Container>
        <Typography variant="heading" size="large">
          This is the content of the first box. It should be aligned to the left
        </Typography>
        <Typography>We'll add a form here soon</Typography>
      </Container>
    </Section>
  );
};

export default ContentLeft;
